    Page have been corrected. The receipts on Schedule A for Line 17 are for Voter
    File Purchase. The prices paid for voter file purchases are established using
    comparable prices charged by other state party committees throughout the country
    on a per record cost. The exact price paid to the Committee by each entity is
    determined by multiplying the per record cost by the number of records provided
    in the file purchased, or a set price for a statewide voter file, also determined
    by the total number of records included in the file.  This is considered the 'usual
    and normal charge' for the good provided. "
